8.13' font-size='5.25pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'>6<\/text>\n   <text x='259.4' y='249.97' font-size='5.25pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'>7<\/text>\n   <text x='259.4' y='241.81' font-size='5.25pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'>9<\/text>\n   <text x='259.4' y='233.66' font-size='5.25pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'>2<\/text>\n   <text x='259.4' y='225.5' font-size='5.25pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'>4<\/text>\n   <text x='259.4' y='217.34' font-size='5.25pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'>5<\/text>\n   <text x='259.4' y='209.18' font-size='5.25pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'>1<\/text>\n   <text transform='translate(242.20,257.83) rotate(-90.00)' font-size='5.25pt' font-family='DejaVu Sans' fill='#276BB0' fill-opacity='1'>Deme<\/text>\n   <text x='269.15' y='303.14' font-size='5.25pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'>0<\/text>\n   <text x='283.19' y='303.14' font-size='5.25pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'>50<\/text>\n   <text x='297.23' y='303.14' font-size='5.25pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'>100<\/text>\n   <text x='313.5' y='303.14' font-size='5.25pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'>150<\/text>\n   <text x='279.78' y='312.44' font-size='5.25pt' font-family='DejaVu Sans' fill='#276BB0' fill-opacity='1'>No. Plants<\/text>\n   <text x='252.42' y='185.95' font-size='6pt' font-family='DejaVu Sans' fill='#272AB0' fill-opacity='1'>Total number of plants<\/text>\n   <text x='260.5' y='194.59' font-size='6pt' font-family='DejaVu Sans' fill='#272AB0' fill-opacity='1'>counted per deme<\/text>\n  <\/g>\n  <g clip-path='url(#svg_59009d30_b752_4f14_a680_be71fa97bbef_c6)'>\n   <text x='15.77' y='52.1' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'>Each point represents a plot where Coast Goldenrod (Solidago <\/text>\n   <text x='15.77' y='60.3' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> spathulata) plants were observed. Nearly all populations may be<\/text>\n   <text x='15.77' y='68.49' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> further subdivided into genetic neighborhoods, or demes, each<\/text>\n   <text x='15.77' y='76.69' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> compromised of more closely related individuals. However, the<\/text>\n   <text x='15.77' y='84.88' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> identification of demes requires molecular approaches, which<\/text>\n   <text x='15.77' y='93.07' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> while becoming cheaper and faster to implement, still have<\/text>\n   <text x='15.77' y='101.27' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> significant bottlenecks to high throughput usage in wildland<\/text>\n   <text x='15.77' y='109.46' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> settings. On the other hand the rapid development of<\/text>\n   <text x='15.77' y='117.66' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> computational capacities and algorithms offer an<\/text>\n   <text x='15.77' y='125.85' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> alternative approach which can be rapidly scaled<\/text>\n   <text x='15.77' y='134.05' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> for the more than 350,000 vascular plant species<\/text>\n   <text x='15.77' y='142.24' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> around the globe.<\/text>\n   <text x='15.77' y='150.44' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> <\/text>\n   <text x='15.77' y='158.63' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> Using the distances regularly travelled by insect<\/text>\n   <text x='15.77' y='166.82' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> pollinators, the portions of a landscape which<\/text>\n   <text x='15.77' y='175.02' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> have the focal plant species growing in them<\/text>\n   <text x='15.77' y='183.21' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> can be clustered into provisional demes.<\/text>\n   <text x='15.77' y='191.41' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> <\/text>\n   <text x='15.77' y='199.6' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> In this project we use field and LiDAR data<\/text>\n   <text x='15.77' y='207.8' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> alongsides several machine learning<\/text>\n   <text x='15.77' y='215.99' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> methods to estimate the abundance of Coast<\/text>\n   <text x='15.77' y='224.19' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> Goldenrod across a landscape in Northern<\/text>\n   <text x='15.77' y='232.38' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> California. We then use these estimates to<\/text>\n   <text x='15.77' y='240.57' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> gauge how the populations of solitary<\/text>\n   <text x='15.77' y='248.77' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> bee which interacts with the Coast<\/text>\n   <text x='15.77' y='256.96' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> Goldenrod may be limited by the<\/text>\n   <text x='15.77' y='265.16' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> availabilty of this species abundance<\/text>\n  <\/g>\n  <g clip-path='url(#svg_59009d30_b752_4f14_a680_be71fa97bbef_c7)'>\n   <text x='290.85' y='67.21' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'>Here we have naively clusted portions<\/text>\n   <text x='294.95' y='75.4' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> of this population using DBSCAN set<\/text>\n   <text x='296.55' y='83.6' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> to an eps of 110 meters. The edges<\/text>\n   <text x='296.87' y='91.79' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> between the nodes cover distances<\/text>\n   <text x='312.37' y='99.99' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> of 100-400m. While the entire<\/text>\n   <text x='283.64' y='108.18' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> population covers a larger expanse, just<\/text>\n   <text x='285.39' y='116.38' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> a few clusters contain most individuals.<\/text>\n   <text x='303.6' y='124.57' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> For applying ex situ conservation<\/text>\n   <text x='279.86' y='132.76' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> these clusters may prove the most viable<\/text>\n   <text x='280.87' y='140.96' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> to sample in order to obtain an adequate<\/text>\n   <text x='283.94' y='149.15' font-size='4.27pt' font-family='DejaVu Sans' fill='#57ACDC' fill-opacity='1'> amount of a populations allelic diversity<\/text>\n  <\/g>\n <\/g>\n<\/svg>","js":null,"uid":"svg_59009d30_b752_4f14_a680_be71fa97bbef","ratio":1.2,"settings":{"tooltip":{"css":".tooltip_SVGID_ { background: linear-gradient(145deg, #f0f0f0, #e6e6e6);\n  border: none;\n  border-radius: 12px;\n  box-shadow: 3px 3px 10px #d1d1d1, -3px -3px 10px #ffffff;\n  color: #333;\n  font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;\n  font-size: 52px;\n  padding: 12px;\n  transition: all 0.5s ease-out; ; position:absolute;pointer-events:none;z-index:999;}","placement":"doc","opacity":0.9,"offx":10,"offy":0,"use_cursor_pos":true,"use_fill":false,"use_stroke":false,"delay_over":200,"delay_out":500},"hover":{"css":".hover_data_SVGID_ { fill:orange; }","reactive":false,"nearest_distance":null},"hover_inv":{"css":".hover_inv_SVGID_ { opacity:0.5; }"},"hover_key":{"css":".hover_key_SVGID_ { fill:orange;stroke:black;cursor:pointer; }\ntext.hover_key_SVGID_ { stroke:none;fill:orange; }\ncircle.hover_key_SVGID_ { fill:orange;stroke:black; }\nline.hover_key_SVGID_, polyline.hover_key_SVGID_ { fill:none;stroke:orange; }\nrect.hover_key_SVGID_, polygon.hover_key_SVGID_, path.hover_key_SVGID_ { fill:orange;stroke:none; }\nimage.hover_key_SVGID_ { stroke:orange; }","reactive":true},"hover_theme":{"css":".hover_theme_SVGID_ { fill:orange;stroke:black;cursor:pointer; }\ntext.hover_theme_SVGID_ { stroke:none;fill:orange; }\ncircle.hover_theme_SVGID_ { fill:orange;stroke:black; }\nline.hover_theme_SVGID_, polyline.hover_theme_SVGID_ { fill:none;stroke:orange; }\nrect.hover_theme_SVGID_, polygon.hover_theme_SVGID_, path.hover_theme_SVGID_ { fill:orange;stroke:none; }\nimage.hover_theme_SVGID_ { stroke:orange; }","reactive":true},"select":{"css":".select_data_SVGID_ { fill:red;stroke:gray; }","type":"single","only_shiny":false,"selected":[]},"select_inv":{"css":""},"select_key":{"css":".select_key_SVGID_ { fill:red;stroke:black;cursor:pointer; }\ntext.select_key_SVGID_ { stroke:none;fill:red; }\ncircle.select_key_SVGID_
